import React, { Component } from 'react';
import { View, ScrollView, Text, StyleSheet } from 'react-native';
import Listitem from "./list";
import Detail from "./detail";
import foData from "../content/data.json";
import foMenu from "../content/menu.json";

export default class Content extends Component {    
  render(){    
    console.log("id:" + this.props.section);
    const section = this.props.menu == true ? foMenu.find(item => item.id == this.props.section) : foData.find(item => item.id == this.section);
    this.list = section.list;
    console.log("content1: " + this.list);
    return (      
      <View>
        <ScrollView contentContainerStyle={styles.contentContainer}>
          {/* <Listitem source={this.props.source} /> */}
        </ScrollView>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  contentContainer: {
    paddingVertical: 20
  }
});
